import React from "react";

const FaceRecognition = () => {
	return (
		<div className="center">
			<img
				src={
					"https://images.theconversation.com/files/430501/original/file-20211105-10492-raehl0.jpg?ixlib=rb-1.1.0&q=45&auto=format&w=1200&h=675.0&fit=crop?size=100x100"
				}
				alt="logo"
			/>
		</div>
	);
};

export default FaceRecognition;
